import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import BotCollection from './components/BotCollection';
import YourBotArmy from './components/YourBotArmy';
import BotSpecs from './components/BotSpecs'; // Optional - for advanced deliverable

function App() {
  return (
    <Router>
      <div>
        <Route exact path="/" component={BotCollection} />
        <Route path="/your-bot-army" component={YourBotArmy} />
        <Route path="/bot/:id" component={BotSpecs} /> {/* Optional - for advanced deliverable */}
      </div>
    </Router>
  );
}

export default App;
